/* GENERATED FILE */
import * as React from 'react';
import Svg, { Rect, Polygon, Polyline, Line } from 'react-native-svg';

import { IconProps } from '../lib';

function AngularLogo(props: IconProps) {
  return (
    <Svg
      viewBox="0 0 256 256"
      width={props.size}
      height={props.size}
      fill={props.color}
      {...props}
    >
      <Rect width={256} height={256} fill="none" />
      <Polygon
        points="128 232 208 192 224 72 128 32 32 72 48 192 128 232"
        opacity={0.2}
      />
      <Polygon
        points="128 232 208 192 224 72 128 32 32 72 48 192 128 232"
        fill="none"
        stroke={props.color}
        strokeLinecap="round"
        strokeLinejoin="round"
        strokeWidth={16}
      />
      <Polyline
        points="164 160 128 88 92 160"
        fill="none"
        stroke={props.color}
        strokeLinecap="round"
        strokeLinejoin="round"
        strokeWidth={16}
      />
      <Line
        x1={102.7}
        y1={138.7}
        x2={153.3}
        y2={138.7}
        fill="none"
        stroke={props.color}
        strokeLinecap="round"
        strokeLinejoin="round"
        strokeWidth={16}
      />
    </Svg>
  );
}

export default AngularLogo;
